import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


const tasks = [
  { id: "0", name: "Выучить реакт", isDone: false },
  { id: "1", name: "Разобраться в хуках", isDone: false },
  { id: "2", name: "Ничего не понимать", isDone: false }
];

ReactDOM.render(
  <React.StrictMode>
    <App tasks={tasks} />
  </React.StrictMode>,
  document.getElementById('root')
);
